        <h1><span class="secnum" id="sec-25.2.2.2"><a href="/sec/sec-generatorfunction.prototype.html" title="link to this section">25.2.2.2</a></span> GeneratorFunction.prototype</h1>

        <p>The initial value of <code>GeneratorFunction.prototype</code> is the intrinsic object %Generator%.</p>
